const initialState = 0;

const counterReducer = (state = 0, action) => {
    console.log("reducer" , action);
  switch (action.type) {
    case "INCREMENT":
      return state = state + 1;
    case "DECEREMENT":
      return state = state - 1;
    default:
      return state;
  }
};

export default counterReducer;
